import React from 'react'

import { useSelector } from 'react-redux'
import CardProduct from './CardProduct';


function Card() {

    var price_total = 0
    const products = useSelector(state => state.products)
    const filteredProducts = products.filter((product) => product.id >= 20);
    filteredProducts.forEach((product) => {
        price_total += product.inStock * product.price;
    });

    return (
        <div>
            <h1> This is my Card </h1>
            <h1>Price total: {price_total}</h1>
            {filteredProducts.map(product => <CardProduct key={product.id} {...product} />)}

        </div>
    )
}
export default Card
